//=== Routine ===============================================================
function check_url(url) {
  if(!url) { return false; }
  if(url.match(/^data\:/)) { return true; }
  if(ONLY_DATA) { return false; }
  if(url.match(/^https?\:\/\//)) { return true; }
  return false;
}

function bindcard(img,urlB,bigimg) {
  img.addEventListener('mouseover', function() {
    bigimg.style.setProperty('background','url("'+urlB+'")','');
    bigimg.style.setProperty('display','block','');
  },true);
  img.addEventListener('mouseout', function(e) {
    bigimg.style.setProperty('display','none','');
    img.style.removeProperty('z-index');
  },true);

  img.addEventListener('mousedown', function(e) {
    e.preventDefault();
    img.style.setProperty('z-index','99','');
  },false);
  img.addEventListener('mouseup', function(e) {
    img.style.removeProperty('z-index');
  },false);
}

function displayCode(el,mark,list) {
  const CARD_SPACE=18;
  var infodefault=CODE_LIST['default'];
  var infodefaultElite=CODE_LIST['elite'];

  function DisplayCard(div,bigimg,code,posX,posY,bcolor) {
    var info=CODE_LIST[code];
    if(!info) { if(code<'6qq') { info=infodefault; } else { info=infodefaultElite; } if(!info) { return false; } }
    var vtop=-6; urlS_fail=true;
    var urlS=info[1];
    if(typeof(urlS)=='number') { vtop=vtop+urlS; urlS=null; }
    else if(!check_url(urlS)) { if(code<'6qq') { urlS=infodefault[1]; } else { urlS=infodefaultElite[1]; } if(!check_url(urlS)) { return false; } }
    else { urlS_fail=false; }
    var urlB=info[2];
    if(!check_url(urlB)) { if(code<'6qq') { urlB=infodefault[2]; } else { urlB=infodefaultElite[2]; } if(!check_url(urlB)) { return false; } }

    var img=document.createElement('div');
    if(SHOW_HINT) { if(SHOW_CODE) { img.setAttribute('title','['+code+'] '+info[0]); } else { img.setAttribute('title',info[0]); } }
    img.setAttribute('style','width:71px; height:71px; position:absolute; border:1px solid '+bcolor);
    img.style.setProperty('left',(15+posX*(72+15))+'px','');
    img.style.setProperty('top' ,(8+posY*CARD_SPACE)+'px','');
    img.style.setProperty('background','url("'+urlS+'")','');
    if(urlS_fail) {
      if(info[2]) {
        var diva=document.createElement('div');
        diva.setAttribute('style','width:71px; height:11px; position:absolute; top:0; left:0;');
        diva.style.setProperty('background','url("'+urlB+'") -5px '+vtop+'px','');
        img.appendChild(diva);
        var divb=document.createElement('div');
        divb.setAttribute('style','width:71px; height:60px; position:absolute; top:11px; left:0;');
        if(code.match(/^mark\-/)) { divb.style.setProperty('background','url("'+urlB+'") -36px -58px',''); }
        else { divb.style.setProperty('background','url("'+urlB+'") -36px -68px',''); }
        img.appendChild(divb);
      } else {
        img.style.setProperty('border-color','#888888','');
    } }
    div.appendChild(img);
    bindcard(img,urlB,bigimg);
    return true;
  }

  var div=document.createElement('div');
  div.setAttribute('style','width:812px; height:252px; position:relative; margin-bottom:3px;');
  div.style.setProperty('background-image','url("data:image/png;base64,")','');
  div.style.setProperty('background-repeat','no-repeat','');

  var bigimg=document.createElement('div');
  bigimg.setAttribute('style','width:144px; height:222px; position:absolute; top:14px; left:656px;');
  bigimg.style.setProperty('display','none','');
  div.appendChild(bigimg);

  var posX=0; var posY=0; var lg=list.length;
  for(var h=0;h<lg;h++) {
    if(DisplayCard(div,bigimg,list[h],posX,posY,'#FFFFFF')) { posY=posY+1; if(posY>9) { posY=0; posX=posX+1; } }
  }
  if(mark) { DisplayCard(div,bigimg,mark,6.3,0,'#FFFF88'); }

  el.style.setProperty('overflow','auto','important');
  el.parentNode.insertBefore(div,el.previousSibling);
}

function previousElement(el) { if(el) { do { el=el.previousSibling; } while(el && el.nodeType!=1); } return el; }

function checkCode(el) {
  var mark=''; var txt=''; var m=null;
  var pel=previousElement(el);
  if(pel && pel.hasAttribute('class') && pel.getAttribute('class').match(/codeheader/i)) {
    m=pel.textContent.match(/^\s*(.*?)\s*\:?\s*\[/i);
    if(m) { mark=m[1]; txt=el.textContent; }
  }
  if(!m) {
    m=el.textContent.match(/^\s*\[(deck|card)(?:\=(\w+))?\](.+)\[\/\1\]\s*$/i);
    if(m) { mark=m[2]; txt=m[3]; }
  }
  if(!m) { mark=''; txt=el.textContent; }
  mark=mark.toLowerCase(); if(MARK_LIST[mark]) { mark=MARK_LIST[mark]; } else { mark=''; }

  var res=[mark];
  do {
    m=txt.match(/^\s*(\d\w\w)(?:\s*|$)(.*)$/);
    if(!m) {
      m=txt.match(/^\s*([\w\-]+)(?:\s*|$)(.*)$/);
      if(!m || !CODE_LIST[m[1]]) { return null; }
    }
    res.push(m[1]);
    txt=m[2];
  } while(txt!='');
  return res;
}

function testCode() {
  const LIMIT=70;
  function keyList(list) {
    var keys=[];
    for(var key in list) {
      if(key.match(/^mark\-/)) { keys.push(key); }
      if(key.match(/^\d\w\w$/)) { keys.push(key); }
    }
    return keys;
  }
  var quickModForm=document.getElementById('quickModForm');
  if(!quickModForm) { return; }
  var listfull=keyList(CODE_LIST); var lg=Math.ceil(listfull.length/LIMIT);
  for(var h=0;h<lg;h++) {
    var div=document.createElement('div');
    var code=document.createElement('code');
    code.setAttribute('style','margin-bottom:4px');
    code.textContent=listfull.slice((h*LIMIT),((h+1)*LIMIT)).join(' ');
    quickModForm.parentNode.insertBefore(div,quickModForm);
    quickModForm.parentNode.insertBefore(code,quickModForm);
  }
}

function main() {
  if(SHOW_TEST) { testCode(); }
  var elems=null; try { elems=document.evaluate("//code",document,null,XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE,null); } catch(err) { elems=null; }
  if(elems) {
    for(var h=elems.snapshotLength-1;h>=0;h--) {
      var elem=elems.snapshotItem(h);
      var res=checkCode(elem);
      if(!res) { continue; }
      if(HIDE_BCCI) { 
        var bcci=previousElement(previousElement(elem));
        if(bcci && (bcci.nodeName=='IMG')) {
          var url=bcci.getAttribute('src');
          if(url && url.match(/^http\:\/\/elementsforum\.co\.cc\/deck/)) {
            bcci.style.setProperty('display','none','')
      } } }
      var mark=res.shift(); if(mark) { res=res.slice(0,60); } else { res=res.slice(0,70); }
      displayCode(elem,mark,res);
    }
  }
}
main();

